import BatsmenItem from './BatsmenItem';

function BatsmenBox(props) {

    return (
        <div>
            {props.batsmen.map((batsman, index) => (
            <BatsmenItem key={index} name={batsman[0]} runs={batsman[1]} balls={batsman[2]} not_out={batsman[3]}/>
            ))}
        </div>
        );

    }
